import './App.css';
import {
  createBrowserRouter,
} from "react-router-dom";
import Home from './components/pages/home/home';

const App = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
  },
  {
    path: "/club/:clubId",
    element: <div>Koozie</div>,
  },
]);


export default App;
